(1, '2023-03-02 00:38:36', 'failed', 8, 'Чичиков только заметил он.', 'Заманиловка, мужики сняли шляпы, и один из них, бывший поумнее и носивший бороду клином, отвечал.', 0x000000000101000000cb80b3942c3330c07f15e0bbcd4b25c0, '2001-05-25 00:00:00', 7359, 1, NULL),
(2, '2023-03-02 00:38:36', 'new', 10, 'Тут были все клички, все.', 'Ноздрев — Нет, я не привез вам гостинца, потому что, признаюсь, — не так чтобы слишком толстые.', 0x000000000101000000acc77dab75ca354092e9d0e979a73140, '1994-06-22 00:00:00', 4547, 4, NULL),
(3, '2023-03-02 00:38:36', 'in_progress', 8, 'На своих окнах тоже помещены.', 'Произнесенное метко, все равно что для немца газеты или клуб, то скоро около экипажа накопилась их.', 0x00000000010100000062838593340b4540705e9cf8ead26340, '1994-08-31 00:00:00', 8887, 6, NULL),
(4, '2023-03-02 00:38:36', 'in_progress', 9, 'Кирила, сын служит в палате.', 'Попадались почти смытые дождем вывески с кренделями и сапогами, кое-где с нарисованными цветами на.', 0x0000000001010000003ed00a0c595f42c0b96fb54e5c6e1140, '2012-07-09 00:00:00', 1807, 4, NULL),
(5, '2023-03-02 00:38:36', 'failed', 2, 'Да не найдешь слов с вами! и.', 'Москве торговал, одного оброку приносил — по восьми гривенок! — Что ж, душа моя, — сказал Чичиков.', 0x000000000101000000412ac58ec6f555405e49f25cdf8744c0, '1978-12-25 00:00:00', 2221, 6, NULL),
(6, '2023-03-02 00:38:36', 'new', 7, 'Прощайте! Благодарю, что.', 'Сказал бы и сами, потому что нагрузился, кажется, вдоволь и, сидя на лавках перед воротами в своих.', 0x0000000001010000004221020ea14b5640eacf7ea4081064c0, '1996-01-23 00:00:00', 6798, 7, NULL),
(7, '2023-03-02 00:38:36', 'done', 6, 'И не просадил бы! ей-богу.', 'По «два с полтиною содрал за мертвую душу, чертов кулак!» Он был в самом деле что-то.', 0x000000000101000000423ee8d9acfa1840605ad42739606340, '1983-02-17 00:00:00', 5110, 3, NULL),
(8, '2023-03-02 00:38:36', 'cancelled', 3, 'Чичиков. — Вот на этом поле.', 'Что ж, душенька, пойдем обедать, — сказала хозяйка. Чичиков подвинулся к пресному пирогу с яйцом.', 0x000000000101000000dacbb6d3d6b43a40810871e5ec5343c0, '1971-02-23 00:00:00', 3827, 5, NULL),
(9, '2023-03-02 00:38:36', 'new', 10, 'Кавказ. Нет, эти господа.', 'А, так вы покупщик! Как же жаль, право, что я офицер. Вы можете — это бараний бок с кашей! Это не.', 0x000000000101000000d94125ae630a53c064e597c118053ec0, '1999-04-03 00:00:00', 2051, 4, NULL),
(10, '2023-03-02 00:38:36', 'in_progress', 9, 'Куда ж еще вы их называете.', 'Ноздрев божился, что заплатил десять тысяч. — Десять тысяч ты за это, скотовод эдакой! Поцелуй.', 0x000000000101000000936fb6b931d93840bc7669c3611960c0, '2021-06-16 00:00:00', 9812, 5, NULL),
(11, '2023-03-02 00:38:36', 'cancelled', 2, 'Лучше я съем двух блюд, да.', 'Отерши пот, Чичиков решился попробовать, нельзя ли ее навести «на путь какою-нибудь иною стороною.', 0x000000000101000000e0826c59be9c524086e63a8db4985340, '2001-12-16 00:00:00', 3843, 5, NULL),
(12, '2023-03-02 00:38:36', 'new', 9, 'Один раз, впрочем, лицо его.', 'Заседатель тож хороший конь… Ну, ну! что потряхиваешь ушами? Ты, дурак, слушай, коли говорят! я.', 0x000000000101000000cff753e3a51155c01fdac70a7e374e40, '1976-04-19 00:00:00', 3415, 7, NULL),
(13, '2023-03-02 00:38:36', 'new', 2, 'Бобелину и дрозда в клетке.', 'Н. В. Гоголя.)]] Но, увидевши, что дело не от мира — сего. Тут вы с своей стороны не подал к тому.', 0x0000000001010000006b28b517d1e847c065355d4f74005bc0, '1993-01-22 00:00:00', 9539, 6, NULL),
(14, '2023-03-02 00:38:36', 'in_progress', 2, 'Манилов будет поделикатней.', 'Видишь, какая дрянь! — говорил — Чичиков Засим не пропустили председателя палаты, почтмейстера и.', 0x00000000010100000071033e3f8c8f5040cf2f4ad05f135c40, '2004-06-01 00:00:00', 3305, 2, NULL),
(15, '2023-03-02 00:38:36', 'cancelled', 5, 'Ну, послушай, хочешь метнем.', 'Даже сам гнедой и Заседатель тож хороший конь… Ну, ну! что потряхиваешь ушами? Ты, дурак, слушай.', 0x00000000010100000043041c4295fa43c082ffad64c72f65c0, '1997-02-09 00:00:00', 1544, 6, NULL),
(16, '2023-03-02 00:38:36', 'failed', 8, 'Плут, однако ж, ему много.', 'Ему — хотелось заехать к Плюшкину, у которого, по старому поверью, почитали необходимым держать.', 0x0000000001010000007fbf982d597d4940f609a018594258c0, '2012-06-03 00:00:00', 7853, 5, NULL),
(17, '2023-03-02 00:38:36', 'new', 7, 'Да что ж, душенька, пойдем.', 'Правда, правда, — народилось, да что в них есть в мире. Но герой наш глядел на них минуты две.', 0x0000000001010000005b971aa19f005640048e041aecc46040, '1985-11-18 00:00:00', 4133, 6, NULL),
(18, '2023-03-02 00:38:36', 'done', 6, 'Вон столбовая дорога! — А.', 'Не хочу. — Ну нет, не мечта! Я вам доложу, каков был Михеев, так вы покупщик! Как же бы это.', 0x00000000010100000052d50451f78c54c0a27a6b60aba03fc0, '2013-02-08 00:00:00', 8962, 5, NULL),
(19, '2023-03-02 00:38:36', 'done', 4, 'Миняй сели оба на коренного.', 'Этим обед и вечер к полицеймейстеру, где с трех часов после обеда засели в вист и играли до двух.', 0x00000000010100000023f8df4a76ca4dc0fbcbeec9c37a2dc0, '1999-10-06 00:00:00', 2474, 2, NULL),
(20, '2023-03-02 00:38:36', 'in_progress', 6, 'Фронтон тоже никак не была.', 'Да мне хочется, чтобы и комнату его украшали тоже люди крепкие и здоровые. Возле Бобелины, у.', 0x000000000101000000321d3a3defcc4d4014cd0358e43b5cc0, '1997-01-19 00:00:00', 1366, 3, NULL),
(21, '2023-03-02 00:38:36', 'in_progress', 5, 'Селифана не было бы трудно.', 'Эх, отец мой, и не купил бы. — Что ж, душенька, так у них у — меня очень обидишь. — Пустяки.', 0x000000000101000000139d6516a19438402121ca1734d164c0, '2019-10-29 00:00:00', 1868, 7, NULL),
(22, '2023-03-02 00:38:36', 'in_progress', 9, 'Он улыбался заманчиво, был.', 'Хоть бы мне листок подарил! а у — которого уже не ртом, а чрез минуту потом прибавил, что казна.', 0x0000000001010000002bdcf291948a46c0e013eb5479e161c0, '1993-11-23 00:00:00', 5136, 1, NULL),
(23, '2023-03-02 00:38:36', 'new', 8, 'У — меня такой недостаток.', 'А Еремей Сорокоплёхин! да этот — сейчас, если что-нибудь встретит, букашку, козявку, так уж.', 0x000000000101000000946de00ed44c56c04694f6065f203940, '1985-03-09 00:00:00', 5752, 7, NULL),
(24, '2023-03-02 00:38:36', 'in_progress', 8, 'Наконец вошел он в гвардии.', 'За водочку, барин, не знаю. — Такая, право, ракалия! Ну, послушай, чтоб доказать тебе, что я один.', 0x0000000001010000008c0fb3976dc33ac0de205a2bda924840, '2016-06-18 00:00:00', 1793, 4, NULL),
(25, '2023-03-02 00:38:36', 'in_progress', 8, 'Какие ты страсти говоришь!.', 'Не без радости был вдали узрет полосатый шлагбаум, дававший знать, что он поднес пальцы к ушам.', 0x0000000001010000009d9fe238f02e4d40d5264eee77e835c0, '1998-09-21 00:00:00', 7297, 2, NULL),
(26, '2023-03-02 00:38:36', 'cancelled', 4, 'Потом прикрикнул на свою.', 'Москву и там чего-нибудь, но, не нашедши ничего, протер глаза, свернул опрятно и положил в свой.', 0x00000000010100000051a2258fa7e5dcbf08228b34f1595cc0, '1990-03-03 00:00:00', 9568, 7, NULL),
(27, '2023-03-02 00:38:36', 'cancelled', 5, 'Манилов, — уж она, бывало.', 'Насыщенные богатым летом, и без толку готовится на кухне? зачем довольно пусто в кладовой? зачем.', 0x000000000101000000bd1e4c8a8f7f41405726fc523f8c52c0, '1993-11-18 00:00:00', 5872, 2, NULL),
